import React from "react";
import "./App.css";
import CountrySelect from "./countriesList/countriesList";
import countriesDetails from "./countriesList/countryDetail";
import { BrowserRouter as Switch,Route, Link } from "react-router-dom";
import List from './components/List'

function App() {
  return (
    <div className="App App-header">

      <h1>Menu</h1>
      <ul>
        <li>
          <Link className="link" to="/">
            Home
          </Link>
        </li>
        <li className="link">
          <Link className="link" to="/countries">
            Countries
          </Link>
        </li>
        <li className="link">
          <Link className="link" to="/countriesDetails">
            Countries DETAILS
          </Link>
        </li>
      </ul>

     {/* <Switch> */}
      <Route exact path="/" />
      <Route path="/countries" component={List} />
      <Route path="/countriesDetails" component={CountrySelect} />
      {/* </Switch> */}
    </div>
  );
}

export default App;
